import React from "react";
import "../styles/Map.css";

const locations = {
  "A Coruña": { x: 120, y: 50 },
  "Vigo": { x: 70, y: 200 },
  "Pontevedra": { x: 90, y: 180 },
  "Ourense": { x: 140, y: 230 },
  "Lugo": { x: 150, y: 80 },
  "Santiago de Compostela": { x: 130, y: 120 }
};

const MapPNG = ({ alertData }) => {
  return (
    <div className="map-container">
      <img src="/Galicia_map.png" alt="Mapa de Galicia" className="map-image" />

      {alertData.map((alert, index) => (
        locations[alert.city] && (
          <div
            key={index}
            className="map-point"
            style={{
              left: `${(locations[alert.city].x / 500) * 100}%`, 
              top: `${(locations[alert.city].y / 400) * 100}%`,
            }}
          ></div>
        )
      ))}
    </div>
  );
};

export default Map;
